INSERT INTO `event` (`id`, `title`, `begin`, `end`, `short_description`, `long_description`) VALUES
(1, 'FORUM NATIONAL SUR LE SYSTEME D‚ÄôINFORMATION SANITAIRE 2023', '2023-03-09 14:15:00', '2023-03-11 18:45:00', '<p style=\"text-align: left; width: 100%;\"><img style=\"display: block; margin-left: auto; margin-right: auto; width: 100%;\" src=\"data:image/jpeg;base64,\"></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif;\"><strong><span lang=\"FR\" style=\"line-height: 107%;\">FORUM NATIONAL SUR LE SYSTEME D&rsquo;INFORMATION SANITAIRE</span></strong></span></p>\r\n<p style=\"text-align: justify;\">Le syst&egrave;me d\'information (SI) est un &eacute;l&eacute;ment majeur et central au bon fonctionnement d\'une entreprise, d&rsquo;une administration ou de toute autre organisation.</p>\r\n<p style=\"text-align: justify;\">Comme son nom l\'indique, ce sont l\'ensemble des ressources et des moyens mis &agrave; disposition pour la collecte, le stockage, le traitement et la diffusion de la globalit&eacute; des informations au sein d\'une organisation, entre les diff&eacute;rents acteurs concern&eacute;s.</p>\r\n<p style=\"text-align: justify;\">Les ressources utilis&eacute;es peuvent &ecirc;tre d\'ordre mat&eacute;rielles, humaines et immat&eacute;rielles. Et les informations peuvent &ecirc;tre de diff&eacute;rentes natures (financi&egrave;res, comptables, commerciales, logistiques, etc).</p>', '<p><img src=\"data:image/jpeg;base64,\" width=\"112\" height=\"114\"></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt; font-family: helvetica, arial, sans-serif;\"><strong><span lang=\"FR\" style=\"line-height: 107%;\">FORUM NATIONAL SUR LE SYSTEME D&rsquo;INFORMATION SANITAIRE</span></strong></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong><span lang=\"FR\" style=\"font-size: 16.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: FR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span lang=\"FR\" style=\"font-size: 16.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; color: #00b0f0; mso-ansi-language: FR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">COMMUNIQUE DE PRESSE</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-align: justify; line-height: normal;\"><span lang=\"FR\" style=\"font-size: 12.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Le syst&egrave;me d&rsquo;information sanitaire (SIS) tient une place pr&eacute;pond&eacute;rante dans le cadre de renforcement du syst&egrave;me de sant&eacute;. L&rsquo;acc&egrave;s en temps opportun &agrave; une information sanitaire fiable est essentiel &agrave; l&rsquo;&eacute;laboration de politiques, &agrave; une bonne gestion sanitaire, &agrave; une prise de d&eacute;cision fond&eacute;e sur des bases factuelles, &agrave; la rationalisation de l&rsquo;allocation des ressources ainsi qu&rsquo;au suivi et &agrave; l&rsquo;&eacute;valuation. La fourniture de ces donn&eacute;es par le biais de syst&egrave;mes d&rsquo;information sanitaire nationaux demeure g&eacute;n&eacute;ralement insuffisante.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-align: justify; line-height: normal;\"><span lang=\"FR\" style=\"font-size: 12.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Aujourd&rsquo;hui, les risques sanitaires mondiaux imposent un renforcement des syst&egrave;mes de sant&eacute; au niveau national, et une obligation de mise en &oelig;uvre des exigences du R&egrave;glement Sanitaire International (RSI) dont l&rsquo;objet et la port&eacute;e consistent &agrave; pr&eacute;venir la propagation internationale des maladies, &agrave; s&rsquo;en prot&eacute;ger, &agrave; la ma&icirc;triser et &agrave; y r&eacute;agir par une action de sant&eacute; publique proportionn&eacute;e et limit&eacute;e aux risques d&rsquo;elles pr&eacute;sente pour la sant&eacute; publique.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-align: justify; line-height: normal;\"><span lang=\"FR\" style=\"font-size: 12.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Dans son Plan de d&eacute;veloppement du secteur sant&eacute; (PDSS) 2020-2024, le Minist&egrave;re de la Sant&eacute; Publique de Madagascar a pr&eacute;vu des interventions sp&eacute;cifiques, cibl&eacute;es, r&eacute;pondant &agrave; ces besoins, mais dont la r&eacute;alisation n&eacute;cessite une meilleure implication des acteurs, un renforcement de la coordination et une synergie des actions pour un meilleur r&eacute;sultat. De cela d&eacute;pend la performance de notre syst&egrave;me de sant&eacute;.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-align: justify; line-height: normal;\"><span lang=\"FR\" style=\"font-size: 12.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Des assistances techniques accompagnent la conception et la planification des activit&eacute;s sur le Syst&egrave;me d&rsquo;Information Sanitaire (SIS), et la coordination se fait sous le leadership du Minist&egrave;re de la Sant&eacute; Publique, avec l&rsquo;appui des Partenaires techniques et financiers qui interviennent dans le domaine du SIS. Des efforts ont &eacute;t&eacute; r&eacute;alis&eacute;s afin de d&eacute;ployer un syst&egrave;me int&eacute;gr&eacute; efficace, du niveau communautaire jusqu&rsquo;au niveau central, et qui vise &agrave; r&eacute;pondre aux besoins de la sant&eacute; publique. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-align: justify; line-height: normal;\"><span lang=\"FR\" style=\"font-size: 12.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Malgr&eacute; les diff&eacute;rentes strat&eacute;gies mises en &oelig;uvre afin d&rsquo;am&eacute;liorer le syst&egrave;me d&rsquo;information, beaucoup reste &agrave; faire, notamment, dans le domaine des ressources d&eacute;di&eacute;es &agrave; la gestion des informations et l&rsquo;assurance de la qualit&eacute; des donn&eacute;es.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: helvetica, arial, sans-serif;\"><span lang=\"FR\" style=\"font-size: 16pt; line-height: 107%;\"><span lang=\"FR\" style=\"font-size: 16pt; line-height: 107%;\"><span lang=\"FR\" style=\"font-size: 12pt; line-height: 107%;\">Dans ce cadre que le Minist&egrave;re de la sant&eacute; a mis en &oelig;uvre le forum national avec comme slogan &laquo; Un syst&egrave;me d&rsquo;information sanitaire fort, r&eacute;pondant au besoin de la sant&eacute; publique pour une population Malagasy salama &raquo; r&eacute;pondant ainsi &agrave; la vision du Velirano 5 de Son Excellence Monsieur le Pr&eacute;sident de la R&eacute;publique Andry RAJOELINA. Ces 5 jours d&rsquo;atelier sera </span><span lang=\"FR\" style=\"font-size: 12pt; line-height: 107%;\">une opportunit&eacute; pour les parties prenantes dont le Minist&egrave;re de la sant&eacute; publique, les autres institutions, les secteurs priv&eacute;s en sant&eacute;, les ordres, les ONG, les op&eacute;rateurs t&eacute;l&eacute;phoniques et les Partenaires techniques et financiers de s&rsquo;&eacute;changer sur les bonnes pratiques et les probl&eacute;matiques du SIS afin de proposer une solution commune &agrave; son am&eacute;lioration.</span></span></span></span></p>');
INSERT INTO `event` (`id`, `title`, `begin`, `end`, `short_description`, `long_description`) VALUES
